import "./App.css";

import { Route, Routers } from "react-router-dom";
import Home from "./pages/home/Home";
function App() {
  return (
    <div className="App">
      <Routers>
        <Route path="/" element={<Home />} />
      </Routers>
    </div>
  );
}

export default App;
